import React, { useState } from 'react';
import './about_us.css';
import HistoryImage from '../../assets/banners/HistoryImage.jpg'; // Asegúrate de que la ruta de la imagen sea correcta
import TeamImage from '../../assets/banners/TeamImage.jpg'; // Asegúrate de que la ruta de la imagen sea correcta

// Componentes adicionales (si son necesarios)
import History from './history/history';
import Testimony from './testimony/testimony';
import Team from './team/team';

const AboutUs = () => {
  // Puedes agregar estados y funciones aquí si son necesarios

  return (
    <div className="about-us-container">
      <div className="about-us-banner">
        <h1>Conócenos</h1>
        <p>Descubre más sobre nuestra institución.</p>
      </div>

      {/* Sección de Historia */}
      <div className="section white-section">
        <div className="white-section-content">
          <img src={HistoryImage} alt="Nuestra Historia" />
          <h2>Nuestra Historia</h2>
          <p>Descripción breve de la historia de la institución.</p>
          {/* Insertar componente History si es necesario */}
        </div>
      </div>

      {/* Sección de Equipo */}
      <div className="section white-section">
        <div className="white-section-content">
          <img src={TeamImage} alt="Nuestro Equipo" />
          <h2>Nuestro Equipo</h2>
          <p>Información sobre el equipo de trabajo.</p>
          {/* Insertar componente Team si es necesario */}
        </div>
      </div>

      {/* Secciones adicionales para Testimonios, Misión, Visión, etc. */}
      {/* ... */}

    </div>
  );
}

export default AboutUs;
